// SPDX-License-Identifier: MIT
// OpenZeppelin Contracts (last updated v5.0.0) (token/ERC20/ERC20.sol)
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

// 조각 코인 민팅
contract ERC20MintBurnTransferContract is ERC20 {
    uint256 public initialSupply; // 총 발행량
    address public artPieceToken;
    // constructor로 묶은 이유는 총 발행량은 정해져 있기 때문
    // 한 번만 민트
    constructor(
        string memory coinName, // 코인 이름 (ex. "ArtCoin")
        string memory ticker, // 토큰 이름 줄여서 (ex. "ART")
        uint256 _initialSupply // 총 발행량
    ) ERC20(coinName, ticker) {
        initialSupply = _initialSupply * 10 ** 18;
        _mint(msg.sender, initialSupply);
        artPieceToken = address(this);
    }

    function burnTokens(uint256 burnAmount) public {
        _burn(msg.sender, burnAmount * 10 ** 18);
    }

    function transferToken(address to, uint256 amount) public {
        transfer(to, amount * 10 ** 18);
    }
}

contracts/FundRaising.sol.content:
// SPDX-License-Identifier: MIT
// OpenZeppelin Contracts (last updated v5.0.0) (token/ERC20/ERC20.sol)

pragma solidity ^0.8.20;

import "./ERC20MintBurnTransfer.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract FundRaisingContract is ERC20MintBurnTransferContract {
    event TokenReceived(address indexed sender, address indexed tokenAddress, uint256 amount);
    
    mapping(address => uint256) public refunds; // 환불 address 1:1로 맵핑
    mapping(address => uint256) public newCoins; // 새로운 소각 1:1로 맵핑

    address public owner; // 컨트랙트 호출자
    uint256 public raisedAmount; // 총 모금 발행량 갯수
    uint256 public finishTime; // 마감 시간
    address[] public listOfContributors; // ArtCoin 넣은 사람 address

    struct FundInfo {
        address investor;
        address tokenAddress;
        uint256 tokenAmount;
    }

    FundInfo[] public fundInfos;
    uint256 public fundInfosLength;
    address artCoinAddress = 0x39af03C99f8b82602d293737dE6A0eBF5d8f48dB;

    constructor(
        string memory name,
        string memory symbol,
        uint256 initialSupply,
        uint256 _time
    ) ERC20MintBurnTransferContract(name, symbol, initialSupply) {
        owner = msg.sender;
        raisedAmount = 0;
        finishTime = block.timestamp + (_time * 1 minutes);
    }

    // 나중에 컨트랙트 상에서 전송해야 하므로 이더 받는 함수
    receive() external payable {}


    // 투자 함수, 사용자의 주소와 얼마나 투자했는지가 들어옴.
    function fund(address _tokenAddress, uint256 _tokenAmount) external {
        // 사용자가 토큰을 전송했음을 이벤트로 기록
        emit TokenReceived(msg.sender, _tokenAddress, _tokenAmount);

        // 실제 토큰 전송
        require(IERC20(_tokenAddress).transferFrom(
            msg.sender,
            address(this),
            _tokenAmount
        ), "Token transfer failed");

        // 토큰 수집자 목록에 추가
        if (newCoins[msg.sender] == 0) {
            listOfContributors.push(msg.sender);
        }

        // 모금액 증가
        raisedAmount += _tokenAmount;

        // 토큰 증가
        newCoins[msg.sender] += _tokenAmount;
    }

    // 분배 함수
    function distributeFund() external {
        require(msg.sender == owner, "Must be owner");
        require(block.timestamp > finishTime, "Not time OVER");
        require(raisedAmount >= (initialSupply * 4) / 5, "Not goal");

        for (uint256 i = 0; i < listOfContributors.length; i++) {
            address contributor = listOfContributors[i];
            uint256 amount = newCoins[contributor];

            if (amount > 0) {
                newCoins[contributor] = 0;
                _transfer(owner, contributor, amount);
            }
        }
    }

    // 환불 함수
    function refundDistribute() external {
        require(raisedAmount < (initialSupply * 4) / 5, "80% is not over");
        require(block.timestamp > finishTime, "Not over");

        for (uint256 i = 0; i < listOfContributors.length; i++) {
            address contributor = listOfContributors[i];
            uint256 amount = refunds[contributor];

            if (amount > 0) {
                refunds[contributor] = 0;
                payable(contributor).transfer(amount);
            }
        }
    }
}

contracts/ReceiveArtCoin.sol.content:
// SPDX-License-Identifier: MIT
// OpenZeppelin Contracts (last updated v5.0.0) (token/ERC20/ERC20.sol)
pragma solidity ^0.8.20;

import "./FundRaising.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

// FundRaisingContract 상속
contract ReceiveArtCoinContract is FundRaisingContract {
    IERC20 public fundingToken;
    address public mainWalletaddress; // 메인 지갑 주소
    mapping(address => bool) private hasContributed;

    constructor(
        string memory name,
        string memory symbol,
        uint256 _initialSupply, // 초기 조각 총발행량
        uint256 _time, // 시간 상속
        address _tokenAddress // 토큰 컨트랙트
    ) FundRaisingContract(name, symbol, _initialSupply, _time) {
        mainWalletaddress = 0xDaBD9681C6fA9C2675f883FB67a1485038087DD3;
        fundingToken = IERC20(_tokenAddress);
    }

    event NewCoinsUpdated(address indexed _from, uint256 _amount);

    // ts에서 실행, button 이벤트를 주어야 실행가능함.
    function fundToken(address _from, uint256 _amount) external {
        require(block.timestamp < finishTime, "Time Over");
        require(_amount > 0, "You need to donate a positive amount of tokens");
        require(
            _amount + raisedAmount <= initialSupply,
            "Exceeds initial supply"
        );
        bool success = fundingToken.transferFrom(
            _from,
            mainWalletaddress,
            _amount
        );
        require(success, "Token transfer failed");
        raisedAmount += _amount;
        newCoins[_from] += _amount;

        if (!hasContributed[_from]) {
            listOfContributors.push(_from);
            hasContributed[_from] = true;
        }

        emit NewCoinsUpdated(_from, _amount);
    }
}

